import React, { useState, useEffect } from 'react';

export default function Student() {
    const [data, setData] = useState('');
  useEffect(() => {
    fetch('http://localhost:8080/api/test')
      .then((res) => res.json())
      .then(({message}) => setData(message))
      .catch((err) => console.log(err));
  }, []);

  return <div>{data}</div>;
}
